export default (function(a,b,c,d,e,f,g,h,i){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:c,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:c,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:c,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:c,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:10}}},"4f5pLZwk6S":{data:{id:334,attributes:{imdbId:"tt0085248",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNDI4NDU4MTExMV5BMl5BanBnXkFtZTcwNjk0NjgyNA@@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"6.0\u002F10"},{Source:"Metacritic",Value:"34\u002F100"}],item_lang:{data:{id:997,attributes:{title:i,plot:"The Black is stolen from Alec by his former Arabian owners. Alec sets off on an adventure to Arabia to reclaim his beloved horse. Based on the books by Walter Farley.",slug:"the-black-stallion-returns"}}},books:{data:[{id:3126,attributes:{title:i,description:"In this, the second book in the series, the heart-stopping adventures of the Black Stallion continue as Alec discovers that two men are after the Black. One claims to be the Black’s rightful owner and one is trying to kill the beautiful steed. An Arab chieftain proves his ownership of the Black and takes him away, but Alec is determined to find his horse again. Following the pair to Arabia, Alec encounters great evil and intrigue, as only a horse as spectacular as the Black could inspire.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=lezIWBHOKBwC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:d,publisher:e,subtitle:f}},{id:3127,attributes:{title:"The Black Stallion Revolts",description:"After the Black attacks another horse, Alec realizes that the once-wild horse needs more space and freedom, so they head out west to a huge ranch. But a terrible accident separates the two, leaving Alec with amnesia and the Black alone to reclaim the wild life to which he was born. As the Black struggles to survive, and as Alec struggles to remember who he is and his connection to the magnificent stallion in the canyon, a gripping adventure story unfolds.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=faa3EY2fchgC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:g,published:d,publisher:e,subtitle:f}},{id:3128,attributes:{title:"The Black Stallion and Flame",description:"While flying to a race, Alec Ramsay and the Black’s plane crash-lands in the stormy Caribbean. Chance brings the Black to the hidden island home of the giant red stallion, Flame. Such a small island can only support one alpha male. But before the two can fight–a fight that can only result in the death of one–a new danger appears. Together, can the stallions defeat the deadly foe which threatens the lives of the entire herd of wild horses?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=OfTkSc6_GW0C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:g,published:d,publisher:e,subtitle:f}},{id:3129,attributes:{title:"The Black Stallion Legend",description:"Alec Ramsey has fled Hopeful Farm in order to alleviate his grief over Pam’s sudden death. He and the Black are aimlessly wandering through the Arizona desert when they hear an amazing Native American legend: The end of the world is near, but help is promised from a rider on a black horse. Alec shrugs off the wild tale–until disaster strikes from the sky. Suddenly the fate of an entire native tribe is in his hands . . . and the mighty Black is faced with a challenge greater than any race!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=tOEUqi4JsEEC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:g,published:d,publisher:e,subtitle:f}},{id:3130,attributes:{title:"The Black Stallion Adventures",description:"Celebrate The Black Stallion’s seventy-fifth anniversary with four of the Black’s greatest adventures! From the moment Alec first saw the Black Stallion, he knew they were destined to be together. But can he truly trust a stallion whose beauty matches his wild spirit? Follow four of Walter Farley’s most thrilling tales of adventure in this boxed set. Each of these classic tales presents racing stories so exciting, readers will be on the edge of their seats until the last horse crosses the finish line! The adventure set includes The Black Stallion, The Black Stallion Returns, The Black Stallion Revolts, and The Black Stallion’s Ghost.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=oa_rCgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:g,published:"2016-02-02",publisher:"Random House Books for Young Readers",subtitle:"The Black Stallion Returns; The Black Stallion's Ghost; The Black Stallion Revolts"}}]}}},meta:{}}},prerenderedAt:1688531279105}}("movie","Walter Farley","series","2011-09-28","Yearling","",null,1,"The Black Stallion Returns"))